import './App.css';
import Header from './Header';
import ContactList from './ContactList';



function App() {
	const contacts = [
		{
			id: "1",
			"name": "Cherry Wang",
			"email": "cherryw2001@hotmail.com",
		},
		{
			id: "2",
			"name": "Stevo",
			"email": "stevo@hotmail.com",
		},
	];

	state = {
		name:"",
		email:""
	};

	return (
		<div className="uiContainer">
			<div>
				<Header />
				<ContactList contacts={contacts}/>
			</div>
		</div>
	);

};

export default App;
